style.css:
@-moz-document domain("boardgamearena.com"), domain("en.boardgamearena.com") {
/* Base colors */
    body {
        background-color: #fdf6e3;
        color: #657b83;
    }
    
    .bga-game-table {
        background-color: #eee8d5;
        border: 1px solid #93a1a1;
    }
    
    .game-area {
        background-color: #fdf6e3;
        color: #657b83;
    }
    
    .player-board {
        background-color: #eee8d5;
        border: 1px solid #93a1a1;
    }
    
    .game-piece {
        background-color: #eee8d5;
        border: 1px solid #93a1a1;
    }
    
    /* Header and other elements */
    .bga-header, .bga-menu {
        background-color: #eee8d5;
        color: #657b83;
    }
    
    .bga-menu a {
        color: #268bd2;
    }
    
    /* Buttons */
    .button, .btn {
        background-color: #268bd2;
        color: #fdf6e3;
        border: 1px solid #93a1a1;
    }
    
    .button:hover, .btn:hover {
        background-color: #2aa198;
        color: #fdf6e3;
    }
    
    /* Inputs */
    input, textarea, select {
        background-color: #eee8d5;
        color: #657b83;
        border: 1px solid #93a1a1;
    }
    
    input:focus, textarea:focus, select:focus {
        border-color: #268bd2;
    }
    
    /* Tables */
    table {
        background-color: #fdf6e3;
        color: #657b83;
        border: 1px solid #93a1a1;
    }
    
    th, td {
        border: 1px solid #93a1a1;
    }
    
    th {
        background-color: #eee8d5;
    }
    
    tr:nth-child(even) {
        background-color: #eee8d5;
    }
}
